import React from "react";
import Tasbeeh from "./Projects/TasbeehCounter/Tasbeeh";
import { Routes, Route } from "react-router-dom";
import Nav from "./Projects/Nav";
import QuoteApp from "./Projects/QuoteApp/Components/QuoteApp";
import AllProjects from "./AllProjects";
import AllQuotes from "./Projects/QuoteApp/Pages/AllQuotes/AllQuotes";

function App() {
  return (
    <div>
      <Routes>
        <Route path={"/"} element={<AllProjects />} />
        <Route path={"/quote"} element={<AllQuotes/>} />
        <Route path={"/tasbeeh"} element={<Tasbeeh/>} />
      </Routes>
    </div>
  );
}

export default App;
